		public void Execute(IServiceProvider serviceProvider)
		{
			#region PluginConfig
			ITracingService tracingService = (ITracingService)serviceProvider.GetService(typeof(ITracingService));
			IPluginExecutionContext context = (IPluginExecutionContext)serviceProvider.GetService(typeof(IPluginExecutionContext));
			IOrganizationServiceFactory serviceFactory = (IOrganizationServiceFactory)serviceProvider.GetService(typeof(IOrganizationServiceFactory));
			IOrganizationService service = serviceFactory.CreateOrganizationService(context.UserId);
			#endregion

			string orderid = (string)context.InputParameters["OrderID"];

			if (string.IsNullOrWhiteSpace(orderid))
			{
				context.OutputParameters["Status"] = false;
				context.OutputParameters["Message"] = "Orderid is required.";
				return;
			}

			CreateAMCDocument_SalesOrder(service, orderid, context);

		}

		static void CreateAMCDocument_SalesOrder(IOrganizationService service, string orderid, IPluginExecutionContext context)
		{
			try
			{
				string fetchXML = $@"<fetch version=""1.0"" output-format=""xml-platform"" mapping=""logical"" distinct=""false"">
									  <entity name=""salesorder"">
										<attribute name=""name"" />
										<attribute name=""customerid"" />
										<attribute name=""totalamount"" />
										<attribute name=""salesorderid"" />
										<attribute name=""pricelevelid"" />
										<attribute name=""hil_ordertype"" />
										<attribute name=""hil_source"" />
										<attribute name=""hil_source"" />
										<attribute name=""hil_serviceaddress"" />
										<attribute name=""discountamount"" />
										<attribute name=""createdon"" />
										<filter>
										  <condition attribute=""salesorderid"" operator=""eq"" value='{orderid}' />
										</filter>
										<order attribute=""name"" descending=""false"" />
										<filter type=""and"">
										  <condition attribute=""customerid"" operator=""not-null"" />
										  <condition attribute=""pricelevelid"" operator=""not-null"" />
										  <condition attribute=""hil_serviceaddress"" operator=""not-null"" />
										  <condition attribute=""hil_paymentstatus"" operator=""eq"" value=""2"" />
										  <condition attribute=""totalamount"" operator=""gt"" value=""0"" />
										  <condition attribute=""hil_ordertype"" operator=""eq"" value=""1f9e3353-0769-ef11-a670-0022486e4abb"" />
										</filter>
									  </entity>
									</fetch>";

				EntityCollection ec = service.RetrieveMultiple(new FetchExpression(fetchXML));
				if (ec.Entities.Count > 0)
				{
					foreach (Entity ent in ec.Entities)
					{
						string SalesOrderNumber = ent.Id.ToString();
						fetchXML = $@"<fetch version='1.0' output-format='xml-platform' mapping='logical' distinct='false'>
                              <entity name='salesorderdetail'>
                                <attribute name='productid' />
                                <attribute name='productdescription' />
                                <attribute name='salesorderdetailid' />
                                <attribute name='hil_assetserialnumber' />
                                <attribute name='hil_paymenttype' />
                                <attribute name='salesorderid' />
                                <attribute name='hil_assetmodelcode' />
                                <attribute name='createdon' />
                                <attribute name='hil_customerasset' />
                                <order attribute='productid' descending='false' />
                                <filter type='and'>
                                  <filter type='or'>
                                    <condition attribute='hil_isamcdocumentgenerated' operator='eq' value='0' />
                                    <condition attribute='hil_isamcdocumentgenerated' operator='null' />
                                  </filter>
                                  <condition attribute='salesorderid' operator='eq' value='{ent.Id}' />
                                </filter>
                              </entity>
                            </fetch>";
						EntityCollection entOrderline = service.RetrieveMultiple(new FetchExpression(fetchXML));
						if (entOrderline.Entities.Count > 0)
						{
							foreach (Entity orderline in entOrderline.Entities)
							{
								try
								{
									AMCDocumentContent aMCDocumentContent = new AMCDocumentContent();
									string srNo = string.Empty;
									if (orderline.Contains("hil_customerasset"))
										aMCDocumentContent.SrNo = orderline.GetAttributeValue<EntityReference>("hil_customerasset").Name;
									else if (orderline.Contains("hil_assetserialnumber"))
										aMCDocumentContent.SrNo = orderline.GetAttributeValue<string>("hil_assetserialnumber");
									else if (orderline.Contains("hil_assetmodelcode"))
										aMCDocumentContent.SrNo = orderline.GetAttributeValue<EntityReference>("hil_assetmodelcode").Name;


									EntityReference ConsumerRef = ent.GetAttributeValue<EntityReference>("customerid");
									Entity Consumer = service.Retrieve(ConsumerRef.LogicalName, ConsumerRef.Id, new ColumnSet("fullname", "hil_salutation",
										"emailaddress1", "mobilephone"));
									if (Consumer.Contains("fullname"))
									{
										aMCDocumentContent.Name = Consumer.GetAttributeValue<string>("fullname");
									}
									if (Consumer.Contains("emailaddress1"))
									{
										aMCDocumentContent.EmailID = Consumer.GetAttributeValue<string>("emailaddress1");
									}
									if (Consumer.Contains("mobilephone"))
									{
										aMCDocumentContent.moblileNo = Consumer.GetAttributeValue<string>("mobilephone");
									}

									EntityReference AddressRef = ent.GetAttributeValue<EntityReference>("hil_serviceaddress");
									Entity Address = service.Retrieve(AddressRef.LogicalName, AddressRef.Id, new ColumnSet("hil_fulladdress"));
									if (Address.Contains("hil_fulladdress"))
									{
										aMCDocumentContent.FullAddress = Address.Contains("hil_fulladdress") ? Address.GetAttributeValue<string>("hil_fulladdress") : null;
									}

									aMCDocumentContent.AMCPlaneName = orderline.GetAttributeValue<EntityReference>("productid").Name;
									aMCDocumentContent.PaidAmount = Math.Round(ent.GetAttributeValue<Money>("totalamount").Value, 2).ToString();

									fetchXML = $@"<fetch version='1.0' output-format='xml-platform' mapping='logical' top='1' distinct='false'>
                                              <entity name='hil_productcatalog'>
                                                <attribute name='hil_productcatalogid' />
                                                <attribute name='hil_name' />
                                                <attribute name='createdon' />
                                                <attribute name='hil_amctandc' />
                                                <order attribute='hil_name' descending='false' />
                                                <filter type='and'>
                                                  <condition attribute='hil_productcode' operator='eq' value='{orderline.GetAttributeValue<EntityReference>("productid").Id}' />
                                                  <condition attribute='statecode' operator='eq' value='0' />
                                                </filter>
                                              </entity>
                                            </fetch>";
									EntityCollection entcollProductcatalog = service.RetrieveMultiple(new FetchExpression(fetchXML));
									if (entcollProductcatalog.Entities.Count > 0)
									{
										string _warrantyDesc = entcollProductcatalog.Entities[0].GetAttributeValue<string>("hil_amctandc");
										string[] lines = _warrantyDesc.Split('\n');
										string list = @" <ul>";
										foreach (string line in lines)
										{
											list = list + @"<li class='cls_007'>" + line + @"</li>";
										}
										list = list + @"</ul>";
										aMCDocumentContent.List = list;
									}
									string _fileName = "AMCWC" + orderline.Id.ToString() + ".pdf";

									#region Acknowledgement, Warrenty Start & End Date 

									fetchXML = $@"<fetch version='1.0' output-format='xml-platform' top='1' mapping='logical' distinct='false'>
                                                  <entity name='hil_paymentreceipt'>
                                                    <attribute name='hil_paymentreceiptid' />
                                                    <attribute name='hil_transactionid' />
                                                    <attribute name='hil_paymentstatus' />
                                                    <attribute name='hil_bankreferenceid' />
                                                    <attribute name='createdon' />
                                                    <order attribute='createdon' descending='true' />
                                                    <filter type='and'>
                                                      <condition attribute='statecode' operator='eq' value='0' />
                                                      <condition attribute='hil_orderid' operator='eq' value='{ent.Id}' />
                                                    </filter>
                                                  </entity>
                                                </fetch>";

									EntityCollection entPaymentreceipt = service.RetrieveMultiple(new FetchExpression(fetchXML));
									if (entPaymentreceipt.Entities.Count > 0)
									{
										int paymentstatus = entPaymentreceipt.Entities[0].GetAttributeValue<OptionSetValue>("hil_paymentstatus").Value;
										if (paymentstatus != 4)//success
										{
											Console.WriteLine($"Payment not yet received for Order No {0}", SalesOrderNumber);
											continue;
										}
									}
									string AMCStartDate = GetWarrantyStartDate(orderline.GetAttributeValue<EntityReference>("hil_customerasset").Id, entPaymentreceipt.Entities[0].GetAttributeValue<DateTime>("createdon"), service);
									string AMCEndDate = GetWarrantyEndDate(orderline.GetAttributeValue<EntityReference>("productid").Id, Convert.ToDateTime(AMCStartDate), service);

									aMCDocumentContent.AcknowledgementDate = entPaymentreceipt.Entities[0].GetAttributeValue<DateTime>("createdon").ToString("yyyy-MM-dd");
									aMCDocumentContent.StartDate = AMCStartDate;
									aMCDocumentContent.EndDate = AMCEndDate;

									#endregion

									string blobUrl = CreateAMCDocumentFile(aMCDocumentContent, _fileName);
									Console.WriteLine("Document is Created and Uploaded in Blob for Sales Order: {0} for Service/Product: {1} URL: " + blobUrl,
