	            </div>
              </body>
            </html>";

			#endregion
		}

		public static ActionResponse CreateMediaGallary(Entity SalesOrder, Entity SalesOrderline, string Url, IOrganizationService service, IPluginExecutionContext context)
		{
			ActionResponse objresult = new ActionResponse();
			try
			{
				Entity mediagallery = new Entity("hil_mediagallery");
				mediagallery["hil_salesorder"] = new EntityReference("salesorder", SalesOrder.Id);
				mediagallery["hil_name"] = SalesOrderline.Id.ToString().Replace("-", "") + "_AMC Certificate";
				if (SalesOrderline.Contains("hil_customerasset"))
				{
					mediagallery["hil_customerasset"] = SalesOrderline.GetAttributeValue<EntityReference>("hil_customerasset");
				}
				mediagallery["hil_consumer"] = SalesOrder.GetAttributeValue<EntityReference>("customerid");
				mediagallery["hil_mediatype"] = new EntityReference("hil_mediatype", new Guid("cfb966f4-d370-ef11-a671-7c1e5232c9eb"));//AMC Certificate
				mediagallery["hil_url"] = Url;
				service.Create(mediagallery);
				objresult.IsSuccessful = true;

				context.OutputParameters["Status"] = true;
				context.OutputParameters["Message"] = "AMC Certificate Posted";

				return objresult;
			}
			catch (Exception ex)
			{
				objresult.IsSuccessful = false;
				objresult.Message = ex.Message;
				return objresult;
			}
		}

